import React from 'react'
import AvatarUploader from 'reat-avatar-uploader'

class Avatar extends React.Component {
  render() {
    <AvatarUploader
    size={150}
    oploadURL={'http://localhost:3000'}
    fileType={'image/png'}
    />
  }
}

export default Avatar;
